import React from 'react'
import './file.css'
import folder from '../../../../assets/folder.png'
import logo from '../../../../assets/logo.png'

const File = ({file}) => {
    const type = file.type === 'dir' ? folder : logo;
    return (
        <div className='File-container'>
            <img className='File-img' src={file.type === 'dir' ? folder : logo} alt='' />{' '}
            <span className='File-name'>{file.name}</span>{' '}
            <span className='File-date'>{file.updatedAt.split('T')[0]}</span>{' '}
            <span className='File-size'>{file.size}</span>
        </div>
    )
}

export default File;
